// SPDX-License-Identifier: UNLICENSED
pragma solidity >=0.8.0;
contract OnChainManager {

    address public owner; // l'indirizzo del proprietario del contratto
    uint public numContratti; // il numero di contratti presenti

    struct Contract {
        uint id;
        string nome;
        string BlockchainAddress;
        string Address;
        string Abi;
        address proprietario;
    }

    mapping(uint => Contract) private contracts; // mappa che associa l'id del contratto alla sua struttura

    event ContrattoAggiunto(uint id, string nome, string BlockchainAddress, string Address, string Abi, address proprietario); // evento generato quando un nuovo contratto viene aggiunto
    event ContrattoRimosso(uint id, string nome, address proprietario); // evento generato quando un contratto viene rimosso
    event NextAddr(string nextAddress, uint8 counter);

    string private blockChain1;
    string private blockChain2;
    string private blockChain3;
    uint8 private count = 0; 

    //cambiato il set degli indirizzi in modo che con solo onchain non possa essere modificato l'indirizzo dello
    //shard su cui fare deploy dei contratti 
    function setAddress1() public{
        blockChain1 = "http://127.0.0.1:7546";
    }

    function setAddress2() public{
        blockChain2 = "http://127.0.0.1:7547";
    }

    function setAddress3() public{
        blockChain3 = "http://127.0.0.1:7548";
    }


    function getAddress1() public view returns (string memory) {
        return blockChain1;
    }

    function getAddress2() public view returns (string memory) {
        return blockChain2;
    }

    function getAddress3() public view returns (string memory) {
        return blockChain3;
    }

    constructor() {
        owner = msg.sender;
        numContratti = 0;
    }

    //trovare modo per fare un controllo se Abi ha formato giusto????? 
    function aggiungiContratto(string memory nome, string memory Address, string memory Abi) public {
        //require(msg.sender == owner, "Solo il proprietario ha il permesso di aggiungere un contratto");
        numContratti++;
        string memory BlockchainAddress = getNextAddress();
        contracts[numContratti] = Contract(numContratti, nome, BlockchainAddress, Address, Abi, msg.sender);
        emit ContrattoAggiunto(numContratti, nome, BlockchainAddress, Address, Abi, msg.sender);
    }

    function rimuoviContratto(uint _id) public {
        require(msg.sender == owner || contracts[_id].proprietario == msg.sender, "Solo il proprietario del onchain o del contratto ha il permesso di rimuovere un contratto");
        delete contracts[_id];
        emit ContrattoRimosso(_id, contracts[_id].nome, msg.sender);
    }

    function cambiaProprietario(uint _id, address _nuovoProprietario) public {
        require(msg.sender == owner, "Solo il proprietario dell'onchain ha il permesso di cambiare il proprietario di un contratto");
        contracts[_id].proprietario = _nuovoProprietario;
    }


    function getContracts(uint _id) public view returns (Contract memory) {
        require(contracts[_id].id != 0, "Il contratto non esiste");
        Contract memory c = contracts[_id];
        return c;
    }


    function getContrattiByProprietario(address _proprietario) public view returns (uint[] memory) {
        uint[] memory risultati = new uint[](numContratti);
        uint numRisultati = 0;
        for (uint i = 1; i <= numContratti; i++) {
            if (contracts[i].proprietario == _proprietario) {
                risultati[numRisultati] = contracts[i].id;
                numRisultati++;
            }
        }
        uint[] memory risultatiFinali = new uint[](numRisultati);
        for (uint i = 0; i < numRisultati; i++) {
            risultatiFinali[i] = risultati[i];
        }
        return risultatiFinali;
    }


    function setCounter(uint8 counter) public {
        count = (counter + 1) % 3;
    }

    function getCounter() public view returns (uint8) {
        return count;
    }

    function getNextAddress() public returns (string memory) {
        string memory nextAddrs = "";

        uint8 counter = getCounter();

        if (counter == 0) {
            nextAddrs = blockChain1;
        } else if (counter == 1) {
            nextAddrs = blockChain2;
        } else if (counter == 2) {
            nextAddrs = blockChain3;
        }

        setCounter(counter);

        emit NextAddr(nextAddrs, counter);

        return (nextAddrs);
    }



